import React from "react";
import NavBar from "./navbar";
const AboutUs = () => {
  return (
    <>
      <NavBar
        color="black"
        active="none"
        navHidden={this.props.navHidden}
        hideNav={this.props.hideNav}
        switchNavState={this.props.switchNavState}
      />
    </>
  );
};

export default AboutUs;
